import React, { useState, useEffect } from 'react';
import { TextField, Button, Container, Grid, Typography, Paper } from '@mui/material';

const AdminPage = () => {
  const [doctors, setDoctors] = useState([]);
  const [formData, setFormData] = useState({
    first_name: '',
    last_name: '',
    dob: '',
    DOC_PIC: 'null',
    DEGREE_TYPE: '',
  });

  useEffect(() => {
    fetch('http://127.0.0.1:3010/doctor')
      .then(response => response.json())
      .then(data => {
        setDoctors(data);
      })
      .catch(error => {
        console.error('Error fetching doctors:', error);
      });
  }, []);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    fetch('http://127.0.0.1:3010/doctor', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify(formData),
    })
    .then(response => response.json())
    .then(data => {
      setDoctors([...doctors, data]);
      setFormData({
        first_name: '',
        last_name: '',
        dob: '',
        DOC_PIC: 'null',
        DEGREE_TYPE: '',
      });
    })
    .catch(error => {
      console.error('Error creating doctor:', error);
    });
  };

  return (
    <Container sx={{ py: 4 }}>
      <Typography variant="h4" mb={2}>Admin Page</Typography>
      <Paper sx={{ p: 3, mb: 4 }}>
        <form onSubmit={handleSubmit}>
          <Grid container spacing={2}>
            <Grid item xs={6}>
              <TextField
                fullWidth
                label="First Name"
                name="first_name"
                value={formData.first_name}
                onChange={handleChange}
              />
            </Grid>
            <Grid item xs={6}>
              <TextField
                fullWidth
                label="Last Name"
                name="last_name"
                value={formData.last_name}
                onChange={handleChange}
              />
            </Grid>
            <Grid item xs={6}>
              <TextField
                fullWidth
                label="Date of Birth"
                type="date"
                name="dob"
                value={formData.dob}
                onChange={handleChange}
                InputLabelProps={{
                  shrink: true,
                }}
              />
            </Grid>
            <Grid item xs={6}>
              <TextField
                fullWidth
                label="Degree Type"
                name="DEGREE_TYPE"
                value={formData.DEGREE_TYPE}
                onChange={handleChange}
              />
            </Grid>
          </Grid>
          <Button type="submit" variant="contained" mt={2}>
            Create Doctor
          </Button>
        </form>
      </Paper>

      <Typography variant="h4" mb={2}>Doctors</Typography>
      <ul>
        {doctors.map((doctor, index) => (
          <li key={index}>{doctor.first_name} {doctor.last_name} - {doctor.DEGREE_TYPE}</li>
        ))}
      </ul>
    </Container>
  );
};

export default AdminPage;
